import React, {useState} from 'react';
import {Link} from 'react-router-dom';
import {FaBars} from 'react-icons/fa';
import {HiX} from 'react-icons/hi';

const data = [
    {
        label : 'HOME',
        to : '/'
    },

    {
        label : 'ABOUT',
        to : '/about'
    },

    {
        label : 'EXPERIENCE',
        to : '/experience'
    },

    {
        label : 'PROJECTS',
        to : '/projects'
    },

    {
        label : 'CONTACT',
        to : '/contact'
    },
]

const Navbar = () => {


    const [toggleIcon, setToggleIcon] = useState(false);

    // func that changes value of toggleIcon (true or false)
    const handleToggleIcon = () => {
        setToggleIcon(!toggleIcon); //sets the new state to the opposite of its current valu
    };

    return (
        <div>
            <nav class="navbar">
                <div class="navbar-container">
                    <Link to = {'/'} class="navbar-container-logo">
                    KY
                    </Link>
                </div>
                <ul class="navbar-container-menu">
                    {
                        data.map((item, key)=> (
                            <li key={key} class="navbar-container-menu-item">
                                <Link to={item.to} class="navbar-container-menu-item-link">
                                    {item.label}
                                </Link>
                            </li>
                        ))
                    }
                </ul>

                <div class="nav-icon" onClick={handleToggleIcon}>
                    {
                        // check if toggleIcon is true. If it is,render HiX, else render FaBars
                        toggleIcon ? <HiX size="30"/> : <FaBars size="30"/>
                    }
                </div>
            </nav>
        </div>
    )
}

export default Navbar;
